CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_CloseAPeriod` (IN `_acyear` INT, IN `_acmonth` INT, IN `_encoder` INT)  BEGIN

	delete from t_sumbook where acmonth=_acmonth and acyear=_acyear and acmonth<>0;
	
	UPDATE t_book set id_item=null where (id_item = 0 or id_item='') and acmonth=_acmonth and acyear=_acyear;
	UPDATE t_book set id_asset=null where (id_asset = 0 or id_asset='') and acmonth=_acmonth and acyear=_acyear;
	UPDATE t_book set idnum=null where (idnum = 0 or idnum='') and acmonth=_acmonth and acyear=_acyear;
		
	DELETE FROM t_sumbook where acyear=_acyear and acmonth=_acmonth;

	SELECT acyear,acmonth,id_gla,id_location,id_branch,id_function,id_expense,id_item, 
	id_asset,idnum,quanty,sum(amount) as amount,_encoder,curdate(),curtime() 
	FROM t_book
	where acmonth=_acmonth and acyear=_acyear
	group by id_gla,id_location,id_branch,id_function,id_expense,id_item, 
	id_asset,idnum order by id_gla;
	
	
	SELECT _acyear,0 as acmonth,t.id_gla,t.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item, 
	t.id_asset,t.idnum,t.quanty,0.00 as amount,null,curdate(),curtime()
	from t_book t
	left join t_sumbook s 
	on 
	t.id_gla=s.id_gla and ifnull(t.id_location,'000')=ifnull(s.id_location,'000') and ifnull(t.id_branch,'0000')=ifnull(s.id_branch,'0000')
	and ifnull(t.id_function,'0000')=ifnull(s.id_function,'0000') and ifnull(t.id_expense,'0000')=ifnull(s.id_expense,'0000') 
	and ifnull(t.id_item,0)=ifnull(s.id_item,0) and ifnull(t.id_asset,0)=ifnull(s.id_asset,0) and ifnull(t.idnum,0)=ifnull(s.idnum,0) 
	and s.acmonth=0 and s.acyear=_acyear 
	where t.acmonth=_acmonth and t.acyear=_acyear  and s.id_tsumbook is null and t.id_gla in ('1311')
	group by t.id_gla,t.id_location,s.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item,t.id_asset,t.idnum
	order by t.id_gla;
	
	SELECT 'Period has been successfully closed' as Message;
    
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_CumulativeIncomeStatement` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
    
    declare _thismonthamount1 decimal(12,2);
    declare _todateamount1 decimal(12,2);
    declare _budgetamount1 decimal(12,2);
    declare _actualamount1 decimal(12,2);
	declare _budget1 decimal(12,2);
    declare _thismonthamount2 decimal(12,2);
    declare _todateamount2 decimal(12,2);
    declare _budgetamount2 decimal(12,2);
    declare _actualamount2 decimal(12,2);
	declare _budget2 decimal(12,2);
    
	CREATE TEMPORARY TABLE `temp` (
	  `id_gla` varchar(5) DEFAULT NULL,
      `id_expense` varchar(4) DEFAULT NULL,
	  `name` varchar(50) NULL,
      `thismonthamount` decimal(12,2) DEFAULT NULL,
	  `todateamount` decimal(12,2) DEFAULT NULL,
      `budgetamount` decimal(12,2) DEFAULT NULL,
      `actualamount` decimal(12,2) DEFAULT NULL,
      `budget` decimal(12,2) DEFAULT NULL
	) ENGINE=InnoDB DEFAULT CHARSET=utf8;
    
    create temporary table temp2 like temp;
    create temporary table temp3 like temp;
	
    select '','','REVENUE CHARGES:',null,null,null,null,null;
    
	SELECT s.id_gla,'',c.name,NULL,sum(ifnull(s.amount,0)) as ToDATE,(c.annualbudget/12)*_acmonth,null,
	sum(ifnull(s.amount,0)) / ((c.annualbudget/12)*_acmonth)*100
	FROM t_sumbook s
    left join m_chartofaccounts c on s.id_gla=c.idgla
    where s.id_gla in ('8511','8512','8514','8513','8515','8516')
    and s.acyear=_acyear and s.acmonth<=_acmonth
    group by s.id_gla;
    
    
    update temp set budgetamount=(
		select annualbudget from m_chartofaccounts where idgla='8516'
    ) where id_gla='8516' limit 10000;
    
    
    update temp set budget=(
		select (temp.todateamount / annualbudget)*100 from m_chartofaccounts where idgla='8516'
    ) where id_gla='8516' limit 10000;
    
    update temp set temp.thismonthamount=(
		select sum(ifnull(s.amount,0)) from t_sumbook s 
        inner join m_chartofaccounts c on c.idgla=s.id_gla
        where s.id_gla=temp.id_gla
		and s.acyear=_acyear and s.acmonth=_acmonth
        group by s.id_gla
    ) Limit 100000;

	update temp set temp.actualamount=(
		select sum(ifnull(s.amount,0)) from t_sumbook s 
        inner join m_chartofaccounts c on c.idgla=s.id_gla
        where s.id_gla=temp.id_gla
		and s.acyear=(_acyear-1) and s.acmonth<=_acmonth
        group by s.id_gla
    ) Limit 100000;
    
    select * from temp;
    
    select '','','Total',sum(thismonthamount),sum(todateamount),sum(budgetamount),sum(actualamount),sum(budget) from temp;
	
    select '','','OPERATING EXPENSES:',null,null,null,null,null;
    
    SELECT s.id_gla,s.id_expense,e.name,NULL,sum(ifnull(s.amount,0)) as ToDATE,(e.annualbudget/12)*_acmonth,NULL,
	sum(ifnull(s.amount,0)) / ((e.annualbudget/12)*_acmonth)*100
	FROM t_sumbook s
    inner join m_expense e on s.id_expense=e.expensecode
    where s.id_gla in
	('8611') 
    and s.acyear=_acyear and s.acmonth<=_acmonth
    group by s.id_gla,s.id_expense;
    
    update temp3 set temp3.thismonthamount=(
		select sum(ifnull(amount,0)) from t_sumbook where id_gla=temp3.id_gla and id_expense=temp3.id_expense
		and acyear=_acyear and acmonth=_acmonth
        group by id_gla,id_expense
    ) LIMIT 100000;
	
    
    update temp3 set budgetamount=(
		select annualbudget from m_expense where expensecode=temp3.id_expense
    ) where id_expense in ('3151','3153') and id_gla='8611' limit 10000;
    
    
    update temp3 set budget=(
		select (temp3.todateamount / annualbudget)*100 from m_expense where expensecode=temp3.id_expense
    ) where id_expense in ('3151','3153') and id_gla='8611' limit 10000;
    
    
	update temp3 set temp3.actualamount=(
		select sum(ifnull(amount,0)) from t_sumbook where id_gla=temp3.id_gla and id_expense=temp3.id_expense
		and acyear=(_acyear-1) and acmonth<=_acmonth
        group by id_gla,id_expense
    ) LIMIT 100000;
    
    select * from temp3;
    
    select '','','Total',sum(thismonthamount),sum(todateamount),sum(budgetamount),sum(actualamount),sum(budget) from temp3;
    
    
    
    select sum(ifnull(thismonthamount,0)),
        sum(todateamount),
        sum(budgetamount),
        sum(actualamount),
        sum(budget) 
        into _thismonthamount1,_todateamount1,_budgetamount1,_actualamount1,_budget1
        from temp;
        
	select sum(ifnull(thismonthamount,0)),
        sum(todateamount),
        sum(budgetamount),
        sum(actualamount),
        sum(budget) 
        into _thismonthamount2,_todateamount2,_budgetamount2,_actualamount2,_budget2
        from temp3;
    
    select '','','NET INCOME:',_thismonthamount1+_thismonthamount2 as thismonthamount,_todateamount1+_todateamount2 as todateamount,
    _budgetamount1-_budgetamount2 as budgetamount,_actualamount1+_actualamount2 as actualamount,_budget1+_budget2 as budget;
    
    delete from t_retainedearnings where acmonth=_acmonth and acyear=_acyear
    limit 1;
    
	`acyear`,
	`acmonth`,
	`id_gla`,
	`amount`,
	`dateupd`,
	`timeupd`) 
	values(
    _acyear,
    _acmonth,
    '6959',
	_thismonthamount1+_thismonthamount2,
    curdate(),
    curtime()
    );
    
	select id_gla,name,FORMAT(abs(thismonthamount),2) as thismonthamount,
    FORMAT(abs(todateamount),2) as todateamount,FORMAT(abs(budgetamount),2) as budgetamount,
    FORMAT(abs(actualamount),2) as actualamount,FORMAT(abs(budget),2) as budget from temp2;
   
	drop table temp;
    drop table temp2;
    drop table temp3;
   
END$$

