CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetCurrentAccount` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
select * from (
	select 
	t.id_gla,t.docrefno,t.id_document,f.functionname,
	SUM(CASE WHEN amount>=0 THEN amount ELSE 0 END) as Debit,
	SUM(CASE WHEN amount<0 THEN abs(amount) ELSE 0 END) as Credit,sum(amount) as Total
	from t_book t
	left join m_function f on f.idfunction=t.id_function
	where t.id_gla=1133 and t.acmonth=_acmonth and t.acyear=_acyear
	group by t.id_document,t.id_function
    
    union
    
    select 
	null,null,'Sub Total',f.functionname,
	SUM(CASE WHEN amount>=0 THEN amount ELSE 0 END) as Debit,
	SUM(CASE WHEN amount<0 THEN abs(amount) ELSE 0 END) as Credit,sum(amount) as Total
	from t_book t
	left join m_function f on f.idfunction=t.id_function
	where t.id_gla=1133 and t.acmonth=_acmonth and t.acyear=_acyear
	group by t.id_function
    
    ) as k order by k.functionname,k.id_document;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetCVSeries` ()  BEGIN

	SELECT acyear into @acyear FROM m_apperiod limit 1;
    
	if (@acyear=2015) then
    
		select 
		case 
			when DocRefNo <=194 then 195
			else DocRefNo+1
		end
		as CVSeries 
		from t_book where id_document='CV' order by DocRefNo desc limit 1;
        
	elseif(@acyear>2015) then	
    
		select 
		ifnull(max(docrefno),0)+1
		as CVSeries 
		from t_book where id_document='CV' and acyear=@acyear order by DocRefNo desc limit 1;
    
    end if;
    
END$$

