CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetRegisters` (IN `_acyear` INT, IN `_acmonth` INT, IN `_iddocument` CHAR(3), IN `_docrefno` INT)  BEGIN

select acyear,
acmonth,
id_document,
DocRefNo,
DATE_FORMAT(DocDate,'%m/%d/%Y') as DocDate,
id_gla,
coa.name,
id_location,
loc.name,
id_branch,
br.branchname,
id_function,
ifnull(fn.functionname,'') as functionname,
id_expense,
ifnull(ex.name,'') as exname,
case
	when id_item = 'null' then ''
	else
	id_item
	end as id_item,
id_asset,
tbook.idnum,
ifnull(concat(id.family_name,', ',id.first_name,' ',id.middle_name),'') as fullname,
quanty,
case
	when amount > 0 then amount
	else
	0.00
	end as Debit,
case
	when amount < 0 then amount*-1
	else
	0.00
	end as Credit,
FxChnRate,
CheckNo,
DATE_FORMAT(NOW(),'%m/%d/%Y') as CheckDate,
BankCode,
explan01
from t_book as tbook 
left join m_chartofaccounts coa on tbook.id_gla=coa.idgla
left join m_location loc on tbook.id_location=loc.idlocation
left join m_branch br on tbook.id_branch=br.idbranch
left join m_function fn on tbook.id_function=fn.idfunction
left join m_expense ex on tbook.id_expense=ex.expensecode
left join m_idmas id on id.idnum=tbook.idnum
where tbook.acyear=_acyear and tbook.acmonth=_acmonth and tbook.id_document=_iddocument and 
(tbook.DocRefNo=_docrefno and _docrefno <> 0 or _docrefno = 0)
order by tbook.DocRefNo asc;

END$$

