CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetScheduleOfReceivables` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	CREATE TEMPORARY TABLE `temp1` (
		  `idnum` int(6),
		  `borrower` varchar(150),
		  `id_gla` varchar(5) DEFAULT NULL,
		  `id_function` varchar(4) DEFAULT NULL,
		  `functionname` varchar(50) DEFAULT NULL,
		  `lnbal` decimal(20,2) DEFAULT NULL,
		  `debit` decimal(20,2) DEFAULT NULL,
		  `credit` decimal(20,2) DEFAULT NULL
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;

	create temporary table temp2 like temp1;

	select m.idnum,concat(ifnull(m.family_name,''),', ',ifnull(m.first_name,''),' ',ifnull(m.middle_name,'')) as Borrower,
	s.id_gla,s.id_function,f.functionname,sum(s.amount) as LNBalance,null,null from m_idmas m
	left join t_sumbook s on s.idnum=m.idnum
	left join m_function f on f.idfunction=s.id_function
	where s.id_gla=1311 and s.acmonth<=_acmonth-1 and s.acyear=_acyear
    group by s.idnum,s.id_gla,s.id_function
	order by m.idnum;

	select m.idnum,concat(m.family_name,', ',m.first_name,' ',m.middle_name) as Borrower,
	b.id_gla,b.id_function,f.functionname,null,
	case
		when b.amount > 0 then b.amount
		end as Debit,
	case
		when b.amount < 0 then b.amount
		end as Credit
	from m_idmas m
	left join t_book b on b.idnum=m.idnum
	left join m_function f on f.idfunction=b.id_function
	where b.id_gla=1311 and b.acmonth=_acmonth and b.acyear=_acyear
	order by m.idnum;

	select t1.idnum,t1.borrower,t1.id_gla,t1.id_function,l.loantype,t1.lnbal,
    sum(t2.debit) as debit,
    sum(t2.credit) as credit,
    (t1.lnbal+ifnull(sum(t2.debit),0)+ifnull(sum(t2.credit),0)) as lnbal2 
	from temp1 t1 left join temp2 t2 on t1.idnum=t2.idnum and t1.id_gla=t2.id_gla and t1.id_function=t2.id_function 
	left join m_loans l on l.loanname = t1.functionname
    group by t1.id_gla,t1.id_function,t1.idnum
	order by t1.borrower;

	drop table temp1;
	drop table temp2;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetScheduleOfReceivables_try` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	CREATE TEMPORARY TABLE `temp1` (
		  `idnum` int(6),
		  `borrower` varchar(150),
		  `id_gla` varchar(5) DEFAULT NULL,
		  `id_function` varchar(4) DEFAULT NULL,
		  `functionname` varchar(50) DEFAULT NULL,
		  `lnbal` decimal(20,2) DEFAULT NULL,
		  `debit` decimal(20,2) DEFAULT NULL,
		  `credit` decimal(20,2) DEFAULT NULL
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;

	create temporary table temp2 like temp1;
    create temporary table temp3 like temp1;
    create temporary table temp4 like temp1;
    create temporary table temp5 like temp1;

	select m.idnum,concat(ifnull(m.family_name,''),', ',ifnull(m.first_name,''),' ',ifnull(m.middle_name,'')) as Borrower,
	s.id_gla,s.id_function,f.functionname,s.amount as LNBalance,null,null from m_idmas m
	left join t_sumbook s on s.idnum=m.idnum
	left join m_function f on f.idfunction=s.id_function
	where s.id_gla=1311 and s.acmonth<=_acmonth-1 and s.acyear=_acyear
	order by m.idnum;

	select m.idnum,concat(m.family_name,', ',m.first_name,' ',m.middle_name) as Borrower,
	b.id_gla,b.id_function,f.functionname,null,
	case
		when b.amount > 0 then b.amount
		end as Debit,
	case
		when b.amount < 0 then b.amount
		end as Credit
	from m_idmas m
	left join t_book b on b.idnum=m.idnum
	left join m_function f on f.idfunction=b.id_function
	where b.id_gla=1311 and b.acmonth=_acmonth and b.acyear=_acyear
	order by m.idnum;
	
	select t1.idnum,t1.borrower,t1.id_gla,t1.id_function,l.loantype,t1.lnbal,
    sum(t2.debit) as debit,
    sum(t2.credit) as credit
    
	from temp1 t1 
    left join temp2 t2 on t1.idnum=t2.idnum and t1.id_gla=t2.id_gla and t1.id_function=t2.id_function 
	left join m_loans l on l.loanname = t1.functionname
    group by t1.id_gla,t1.id_function,t1.idnum
	order by t1.borrower;
    
    select t1.idnum,t1.borrower,t1.id_gla,t1.id_function,l.loantype,t1.lnbal,
    sum(t1.debit) as debit,
    sum(t1.credit) as credit
    
	from temp2 t1 
    left join temp1 t2 on t1.idnum=t2.idnum and t1.id_gla=t2.id_gla and t1.id_function=t2.id_function 
	left join m_loans l on l.loanname = t1.functionname
    group by t1.id_gla,t1.id_function,t1.idnum;
    
    select * from temp3
    union
    select * from temp4;
	
    select idnum,borrower,id_gla,id_function,functionname as loantype,lnbal,
    debit,
    credit,
    (lnbal+ifnull(sum(debit),0)+ifnull(sum(credit),0)) as lnbal2 
    from temp5
	group by id_gla,id_function,idnum
    order by borrower;
    
	drop table temp1;
	drop table temp2;
    drop table temp3;
	drop table temp4;
    drop table temp5;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetSumBookByGLA` (IN `_id_gla` VARCHAR(5), IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	
	CREATE TEMPORARY TABLE `tempcurrent` (
	  `id_gla` varchar(5) DEFAULT NULL,
	  `glaname` varchar(50) DEFAULT NULL,
	  `id_location` varchar(3) DEFAULT NULL,
	  `id_branch` varchar(4) DEFAULT NULL,
	  `id_function` varchar(5) DEFAULT NULL,
	  `functionname` varchar(50) NULL,
	  `id_expense` varchar(4) DEFAULT NULL,
	  `id_item` varchar(4) DEFAULT NULL,
	  `id_asset` int(6) DEFAULT NULL,
	  `amount` decimal(20,2) DEFAULT NULL
	) ENGINE=InnoDB DEFAULT CHARSET=utf8;
	
	create temporary table tempprevious like tempcurrent;

	SELECT t.id_gla,c.NAME,t.id_location,t.id_branch,t.id_function,
		f.functionname,t.id_expense,t.id_item,t.id_asset,sum(t.amount)*c.nature as total1 
		FROM t_sumbook t
		left join m_chartofaccounts c on t.id_gla=c.idgla 
		left join m_function f on t.id_function=f.idfunction
		where t.id_gla=_id_gla and t.acyear=_acyear and t.acmonth<=_acmonth
		group by t.id_gla,t.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item,t.id_asset
		
        union
        
		SELECT r.id_gla,c.name,c.idlocation,c.idbranch,c.idfunction,null as functionname,
		c.idexpense,null as id_item,null as id_asset,sum(r.amount)*c.nature as total1
		FROM t_retainedearnings r
		left join m_chartofaccounts c on r.id_gla=c.idgla 
		where r.id_gla=_id_gla and r.acyear=_acyear and r.acmonth<=_acmonth;

	SELECT t.id_gla,c.NAME,t.id_location,t.id_branch,t.id_function,
		f.functionname,t.id_expense,t.id_item,t.id_asset,sum(t.amount)*c.nature as total2 
		FROM t_sumbook t
		left join m_chartofaccounts c on t.id_gla=c.idgla 
		left join m_function f on t.id_function=f.idfunction
		where t.id_gla=_id_gla and t.acyear=_acyear and t.acmonth<=(_acmonth-1)
		group by t.id_gla,t.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item,t.id_asset
	
		union
        
		SELECT r.id_gla,c.name,c.idlocation,c.idbranch,c.idfunction,null as functionname,
		c.idexpense,null as id_item,null as id_asset,sum(r.amount)*c.nature as total2
		FROM t_retainedearnings r
		left join m_chartofaccounts c on r.id_gla=c.idgla 
		where r.id_gla=_id_gla and r.acyear=_acyear and r.acmonth<=(_acmonth-1);
    
	select t.*,p.amount as amount2 from tempcurrent t 
	left join tempprevious p
	on t.id_gla=p.id_gla
	and t.id_location=p.id_location
	and t.id_branch=p.id_branch
	and t.id_function=p.id_function
	and t.id_expense=p.id_expense
    where t.id_gla is not null
    order by t.id_gla;

	drop table tempcurrent;
	drop table tempprevious;

END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetSummaryByGLAccount` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
