CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_GetTrialBalance` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	CREATE TEMPORARY TABLE `temp1` (
	  `id_gla` varchar(5) DEFAULT NULL,
	  `name` varchar(50) NULL,
	  `id_location` varchar(3) DEFAULT NULL,
      `locname` varchar(50) DEFAULT NULL,
	  `id_branch` varchar(4) DEFAULT NULL,
      `branchname` varchar(50) DEFAULT NULL,
	  `id_function` varchar(4) DEFAULT NULL,
	  `functionname` varchar(50) DEFAULT NULL,
	  `id_expense` varchar(4) DEFAULT NULL,
	  `expensename` varchar(50) DEFAULT NULL,
	  `id_item` int(11) DEFAULT NULL,
      `itemname` varchar(50) DEFAULT NULL,
	  `id_asset` int(11) DEFAULT NULL,
      `assetname` varchar(50) DEFAULT NULL,
	  `debit` decimal(20,2) DEFAULT NULL,
	  `credit` decimal(20,2) DEFAULT NULL,
      `debit2` decimal(20,2) DEFAULT NULL,
	  `credit2` decimal(20,2) DEFAULT NULL
	) ENGINE=InnoDB DEFAULT CHARSET=utf8;

create temporary table temp2 like temp1;
create temporary table temp3 like temp1;
create temporary table temp4 like temp1;
create temporary table temp5 like temp1;

select c.idgla,c.name,t.id_location,l.name as locname,t.id_branch,m.branchname,
t.id_function,f.functionname,t.id_expense,e.name,t.id_item,i.name as itemname,t.id_asset,a.assetname,
case
	when sum(t.amount) > 0 then sum(t.amount)
	end as Debit,
case
	when sum(t.amount) < 0 then sum(t.amount)
    end as Credit,null,null
from m_chartofaccounts c 
left join t_sumbook t on c.idgla=t.id_gla
left join m_function f on f.idfunction=t.id_function
left join m_expense e on e.expensecode=t.id_expense
left join m_location l on l.idlocation=t.id_location
left join m_branch m on m.idbranch=t.id_branch
left join m_item i on i.iditem=t.id_item
left join m_asset a on a.idasset=t.id_asset
where t.acyear=_acyear and t.acmonth<=_acmonth-1
group by c.idgla,t.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item,t.id_asset
order by c.idgla;

select c.idgla,c.name,t.id_location,l.name as locname,t.id_branch,m.branchname,
t.id_function,f.functionname,t.id_expense,e.name,t.id_item,i.name as itemname,t.id_asset,a.assetname,

SUM(CASE WHEN t.amount>=0 THEN t.amount ELSE 0 END) as Debit,
SUM(CASE WHEN t.amount<0 THEN t.amount ELSE 0 END) as Credit,
null,null
from m_chartofaccounts c 
left join t_book t on c.idgla=t.id_gla
left join m_function f on f.idfunction=t.id_function
left join m_expense e on e.expensecode=t.id_expense
left join m_location l on l.idlocation=t.id_location
left join m_branch m on m.idbranch=t.id_branch
left join m_item i on i.iditem=t.id_item
left join m_asset a on a.idasset=t.id_asset
where t.acyear=_acyear and t.acmonth=_acmonth
group by c.idgla,t.id_location,t.id_branch,t.id_function,t.id_expense,t.id_item,t.id_asset
order by c.idgla;

select * from temp1;

select * from temp2;

select 
t1.id_gla,t1.name,t1.id_location,t1.locname,t1.id_branch,t1.branchname,t1.id_function,t1.functionname,
t1.id_expense,t1.expensename,t1.id_item,t1.itemname,t1.id_asset,t1.assetname,t1.debit,t1.credit,t2.debit as debit2,t2.credit as credit2
from temp1 t1
left join temp2 t2 on t1.id_gla=t2.id_gla 
and t1.id_location=t2.id_location 
and t1.id_branch=t2.id_branch 
and t1.id_function=t2.id_function
and t1.id_expense=t2.id_expense 
and ifnull(t1.id_item,0)=ifnull(t2.id_item,0) 
and ifnull(t1.id_asset,0)=ifnull(t2.id_asset,0)

union

select 
t4.id_gla,t4.name,t4.id_location,t4.locname,t4.id_branch,t4.branchname,t4.id_function,t4.functionname,
t4.id_expense,t4.expensename,t4.id_item,t4.itemname,t4.id_asset,t4.assetname,t3.debit,t3.credit,t4.debit as debit2,t4.credit as credit2
from temp4 t4
left join temp3 t3 on t4.id_gla=t3.id_gla 
and t4.id_location=t3.id_location 
and t4.id_branch=t3.id_branch 
and t4.id_function=t3.id_function
and t4.id_expense=t3.id_expense 
and ifnull(t4.id_item,0)=ifnull(t3.id_item,0) 
and ifnull(t4.id_asset,0)=ifnull(t3.id_asset,0);

select id_gla,name,id_location,locname,id_branch,branchname,id_function,functionname,
id_expense,expensename,id_item,itemname,id_asset,assetname,debit,credit, debit2,credit2,
case
	when ifnull(debit,0)+ifnull(debit2,0)+ifnull(credit,0)+ifnull(credit2,0) >= 0 then ifnull(debit,0)+ifnull(debit2,0)+ifnull(credit,0)+ifnull(credit2,0)
	end as debit3,
case
	when ifnull(debit,0)+ifnull(debit2,0)+ifnull(credit,0)+ifnull(credit2,0) < 0 then ifnull(debit,0)+ifnull(debit2,0)+ifnull(credit,0)+ifnull(credit2,0)
    end as credit3
from temp5 order by id_gla;

drop table temp1;
drop table temp2;
drop table temp3;
drop table temp4;
drop table temp5;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_IndivLoanLedger` (IN `_acyear` INT, IN `_idnum` INT)  BEGIN
	SELECT f.functionname,'Beginning Balance (Sept. 1, 2015)' as description,null as DocRefNo,null as DocDate,s.acyear,s.acmonth,
	s.id_gla,s.id_location,s.id_branch,s.id_function,s.id_expense,s.id_item,s.id_asset,s.idnum,s.quanty,
	case
		when s.amount > 0 then s.amount
		else
		0.00
		end as Debit,
	case
		when s.amount < 0 then s.amount*-1
		else
		0.00
		end as Credit ,
	ifnull(s2.amount,0.00)*-1 as InterestPaid,
    ifnull(s3.amount,0.00)*-1 as FinesPaid
	FROM t_sumbook s 
	left join m_function f on s.id_function = f.idfunction
    left join t_sumbook s2 on s2.id_gla=8511 and s2.acmonth=0 and s2.acyear=_acyear and s2.idnum=_idnum
    left join t_sumbook s3 on s3.id_gla=8513 and s3.acmonth=0 and s3.acyear=_acyear and s3.idnum=_idnum
	where s.id_gla='1311' and s.idnum=_idnum and s.acmonth=0 and s.acyear=_acyear
	union
	SELECT f.functionname,b.id_document,b.DocRefNo,DATE_FORMAT(b.DocDate,'%m/%d/%Y') as DocDate,
	b.acyear,b.acmonth,b.id_gla,b.id_location,
	b.id_branch,b.id_function,b.id_expense,b.id_item,b.id_asset,b.idnum,b.quanty,
	case
		when b.amount > 0 then b.amount
		else
		0.00
		end as Debit,
	case
		when b.amount < 0 then b.amount*-1
		else
		0.00
		end as Credit,
	ifnull(b2.amount,0.00)*-1 as InterestPaid,
    ifnull(b3.amount,0.00)*-1 as FinesPaid
	FROM t_book b
	left join m_function f on b.id_function = f.idfunction
    left join t_book b2 on b2.id_gla=8511 and b2.acyear=_acyear and b2.idnum=_idnum and b2.docrefno=b.docrefno
    left join t_book b3 on b3.id_gla=8513 and b3.acyear=_acyear and b3.idnum=_idnum and b3.docrefno=b.docrefno
	where b.id_gla='1311' and b.idnum=_idnum and b.acyear=_acyear
	order by id_function,acmonth;

END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_SaveAP` (IN `_acyear` INT(4), IN `_acmonth` INT(2), IN `_appcode` VARCHAR(10))  BEGIN
	
