CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_SaveAsset` (IN `_idasset` INT, IN `_assetname` VARCHAR(40), IN `_assetcategory` VARCHAR(10), IN `_encoder` INT)  BEGIN
	
    set _assetname = trim(_assetname);
    set _assetcategory = trim(_assetcategory);
    
    if exists (select idasset from m_asset where idasset=_idasset) then
		if exists(select idasset from m_asset where assetname=_assetname and assetcategory=_assetcategory and idasset=_idasset) then
			Select 'No changes.' as Message;
		elseif exists(select assetname from m_asset where assetname=_assetname and idasset <> _idasset) then
			Select 'Asset name already exists.' as Message;
        else
			update m_asset set assetname=_assetname,assetcategory=_assetcategory,encoder=_encoder,dateupd=curdate(),timeupd=curtime() where idasset=_idasset;
            Select 'Record successfully saved.' as Message;
		end if;
	elseif exists(select assetname from m_asset where assetname=_assetname) then
		Select 'Asset name already exists.' as Message;
	else
        Select 'Record successfully saved.' as Message;
	end if;
    
END$$

