CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_SaveBankRecon` (IN `_bankreconid` INT, IN `_bankcode` CHAR(5), IN `_checkno` CHAR(15), IN `_checkdate` VARCHAR(10), IN `_amount` DECIMAL(9,2), IN `_iddocument` CHAR(3), IN `_docrefno` INT(10), IN `_docdate` VARCHAR(10), IN `_recstat` CHAR(1), IN `_encoder` INT)  BEGIN
	
	set _checkdate=STR_TO_DATE(trim(_checkdate), '%m/%d/%Y');
	set _docdate=STR_TO_DATE(trim(_docdate), '%m/%d/%Y');
	
	if exists (select bankreconid from t_bankrecon where bankreconid = _bankreconid) then
		if exists(select bankreconid from t_bankrecon where bankcode=_bankcode 
		and checkno=_checkno and checkdate=_checkdate and amount=_amount and id_document=_iddocument
		and docrefno=_docrefno and docdate=_docdate and recstat=_recstat and bankreconid=_bankreconid) then
			select 'No changes.' as Message;
		else
			update t_bankrecon set bankcode=_bankcode 
		,checkno=_checkno, checkdate=_checkdate, amount=_amount, id_document=_iddocument
		,docrefno=_docrefno, docdate=_docdate, recstat=_recstat ,
		encoder=_encoder,dateupd=curdate(),timeupd=curtime() where bankreconid=_bankreconid;
			select 'Record successfully updated.' as Message;
		end if;
	else
		values(_bankcode,_checkno,_checkdate,_amount,_iddocument,_docrefno,_docdate,_recstat,_encoder,curdate(),curtime());

		Select 'Record successfully saved.' as Message;
	end if;

END$$

