CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_SaveCOA` (IN `_idcoa` INT, IN `_idgla` VARCHAR(5), IN `_idlocation` VARCHAR(3), IN `_idbranch` VARCHAR(4), IN `_idfunction` VARCHAR(4), IN `_idexpense` VARCHAR(4), IN `_name` VARCHAR(50), IN `_lgitem` TINYINT(1), IN `_lgasset` TINYINT(1), IN `_lgidnum` TINYINT(1), IN `_lgquantity` TINYINT(1), IN `_annualbudget` DECIMAL(20,2), IN `_typrectt` VARCHAR(9), IN `_encoder` INT)  BEGIN
	
	set _idgla=trim(_idgla);
	set _idlocation=trim(_idlocation);
	set _idfunction=trim(_idfunction);
	set _idlocation=trim(_idlocation);
	set _idexpense=trim(_idexpense);
	set _typrectt=trim(_typrectt);
	set _name=trim(_name);
	set _typrectt=trim(_typrectt);
	
	if (trim(_annualbudget) = '') then
