CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_SavingsLedger_Common` (IN `_acyear` INT, IN `_idnum` INT)  BEGIN
	SELECT 'Beginning Balance' as description,acyear,acmonth,id_gla,id_location,id_branch,id_function,id_expense,id_item,id_asset,idnum,quanty,
	case
		when amount > 0 then amount
		else
		0.00
		end as Debit,
	case
		when amount < 0 then amount*-1
		else
		0.00
		end as Credit,null as DocDate,null as DocRefNo
	FROM t_sumbook where id_gla='6911' and idnum=_idnum and acmonth=0 and acyear=_acyear
	union
	SELECT id_document,acyear,acmonth,id_gla,id_location,id_branch,id_function,id_expense,id_item,id_asset,idnum,quanty,
	case
		when amount > 0 then amount
		else
		0.00
		end as Debit,
	case
		when amount < 0 then amount*-1
		else
		0.00
		end as Credit,DATE_FORMAT(DocDate,'%m/%d/%Y') as DocDate,DocRefNo
	FROM t_book where id_gla='6911' and idnum=_idnum and acyear=_acyear
	order by id_function,acmonth;
END$$

