CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_ScheduleofCapitalShare_Common` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	CREATE TEMPORARY TABLE `temp1` (
		  `idnum` int(6),
		  `borrower` varchar(150),
		  `id_gla` varchar(5) DEFAULT NULL,
		  `id_function` varchar(4) DEFAULT NULL,
		  `functionname` varchar(50) DEFAULT NULL,
		  `lnbal` decimal(20,2) DEFAULT NULL,
		  `debit` decimal(20,2) DEFAULT NULL,
		  `credit` decimal(20,2) DEFAULT NULL
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;

	create temporary table temp2 like temp1;

	select m.idnum,concat(ifnull(m.family_name,''),', ',ifnull(m.first_name,''),' ',ifnull(m.middle_name,'')) as Borrower,
	s.id_gla,s.id_function,null,sum(s.amount) as LNBalance,null,null from m_idmas m
	left join t_sumbook s on s.idnum=m.idnum
	where s.id_gla=6911 and s.acmonth<=_acmonth-1 and s.acyear=_acyear
	group by s.idnum,s.id_gla,s.id_function
	order by m.idnum;

	select m.idnum,concat(m.family_name,', ',m.first_name,' ',m.middle_name) as Borrower,
	b.id_gla,b.id_function,null,null,
    
	SUM(CASE WHEN b.amount>=0 THEN b.amount ELSE 0 END) as Debit,
	SUM(CASE WHEN b.amount<0 THEN b.amount ELSE 0 END) as Credit
    
	from m_idmas m
	left join t_book b on b.idnum=m.idnum
	where b.id_gla=6911 and b.acmonth=_acmonth and b.acyear=_acyear
    group by m.idnum
	order by m.idnum;

	select t1.idnum,t1.borrower,t1.id_gla,t1.id_function,null,t1.lnbal*c.nature as lnbal,
    sum(t2.debit) as debit,
    sum(t2.credit) as credit,
    (t1.lnbal+ifnull(sum(t2.debit),0)+ifnull(sum(t2.credit),0))*c.nature as lnbal2 
	from temp1 t1 
    left join temp2 t2 on t1.idnum=t2.idnum and t1.id_gla=t2.id_gla
	left join m_chartofaccounts c on c.idgla=t1.id_gla
    group by t1.id_gla,t1.id_function,t1.idnum
	order by t1.borrower;

	drop table temp1;
	drop table temp2;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_ScheduleofCapitalShare_Prefered` (IN `_acyear` INT, IN `_acmonth` INT)  BEGIN
	CREATE TEMPORARY TABLE `temp1` (
		  `idnum` int(6),
		  `borrower` varchar(150),
		  `id_gla` varchar(5) DEFAULT NULL,
		  `id_function` varchar(4) DEFAULT NULL,
		  `functionname` varchar(50) DEFAULT NULL,
		  `lnbal` decimal(20,2) DEFAULT NULL,
		  `debit` decimal(20,2) DEFAULT NULL,
		  `credit` decimal(20,2) DEFAULT NULL
		) ENGINE=InnoDB DEFAULT CHARSET=utf8;

	create temporary table temp2 like temp1;

	select m.idnum,concat(ifnull(m.family_name,''),', ',ifnull(m.first_name,''),' ',ifnull(m.middle_name,'')) as Borrower,
	s.id_gla,s.id_function,null,sum(s.amount) as LNBalance,null,null from m_idmas m
	left join t_sumbook s on s.idnum=m.idnum
	where s.id_gla=6915 and s.acmonth<=_acmonth-1 and s.acyear=_acyear
    group by s.idnum,s.id_gla,s.id_function
	order by m.idnum;

	select m.idnum,concat(m.family_name,', ',m.first_name,' ',m.middle_name) as Borrower,
	b.id_gla,b.id_function,null,null,
    
	SUM(CASE WHEN b.amount>=0 THEN b.amount ELSE 0 END) as Debit,
	SUM(CASE WHEN b.amount<0 THEN b.amount ELSE 0 END) as Credit
    
	from m_idmas m
	left join t_book b on b.idnum=m.idnum
	where b.id_gla=6915 and b.acmonth=_acmonth and b.acyear=_acyear
    group by m.idnum
	order by m.idnum;

	select t1.idnum,t1.borrower,t1.id_gla,t1.id_function,null,t1.lnbal*c.nature as lnbal,
    sum(t2.debit) as debit,
    sum(t2.credit) as credit,
    (t1.lnbal+ifnull(sum(t2.debit),0)+ifnull(sum(t2.credit),0))*c.nature as lnbal2 
	from temp1 t1 
    left join temp2 t2 on t1.idnum=t2.idnum and t1.id_gla=t2.id_gla
	left join m_chartofaccounts c on c.idgla=t1.id_gla
    group by t1.id_gla,t1.id_function,t1.idnum
	order by t1.borrower;

	drop table temp1;
	drop table temp2;
END$$

CREATE DEFINER=`id615125_ams`@`%` PROCEDURE `sp_YearEndClosing` (IN `_acyear` INT)  BEGIN

if (_acyear < 2015) then
	SELECT 'Invalid year, system starts at 2015' as Message;
else
	delete from t_sumbook where acyear=_acyear+1 and acmonth=0 limit 100000;

	SELECT _acyear+1 as acyear,0 as acmonth,id_gla,id_location,id_branch,id_function,id_expense,id_item,id_asset,idnum,sum(amount) FROM t_sumbook
	where acyear=_acyear and id_gla not in ('8611','8511','8512','8513','8514','8515','8516')
	group by acyear,id_gla,id_location,id_branch,id_function,id_expense,id_item,id_asset,idnum;

	SELECT 'Year-end has been successfully closed' as Message;
end if;
END$$

